css:
atom-php-integrator-symbol-viewer {
  opacity: 1.000;
  max-width: 20vw;
  width: 300px;
  height: 100vh;
  transition: 0.25s ease-in;
  display: flex;
  flex-direction: column;
  background: #20222c;
}
atom-php-integrator-symbol-viewer .toggle-button-container {
  flex: 0;
  display: flex;
  align-items: center;
  justify-content: flex-end;
  cursor: pointer;
  padding: 1px 7px 1px 1px;
}
atom-php-integrator-symbol-viewer .toggle-button-container .toggle-button::before {
  font-size: 20px;
  font-family: "Octicons Regular";
  content: "\f05e";
}
atom-php-integrator-symbol-viewer.collapsed {
  width: 30px;
}
atom-php-integrator-symbol-viewer.collapsed atom-php-integrator-symbol-viewer-content {
  opacity: 0;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content {
  opacity: 0.999;
  width: 100%;
  display: flex;
  flex: 1;
  min-height: 150px;
  overflow-y: auto;
  flex-direction: column;
  font-size: 1.2em;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .highlighted-letter {
  color: #ffffff !important;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .figure-container {
  width: 100%;
  padding: 10px 15px;
  position: relative;
  z-index: 10;
  background-color: #20222c !important;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .figure-container .figure-choice {
  color: #aaaaaa !important;
  background-color: #20222c !important;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container.active {
  display: flex;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container {
  position: relative;
  z-index: 2;
  display: none;
  flex-direction: column;
  flex-grow: 1;
  overflow-x: visible;
  overflow-y: auto;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list {
  margin-left: 15px;
  margin-top: 5px;
  margin-bottom: 5px;
  box-sizing: border-box;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element:hover {
  color: #ffffff;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element {
  margin: 3px 0;
  width: 100%;
  position: relative;
  overflow: visible;
  cursor: pointer;
  transition: color 0.3s;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title {
  display: flex;
  align-items: center;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title .inherited {
  display: inline;
  width: 1.5em;
  margin-right: 0.5em;
  color: #aaaaaa !important;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title .inherited.active:before {
  font-family: "Octicons Regular";
  content: "\f05c";
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title .bullet {
  flex-grow: 0;
  font-size: 1.2em;
  width: 1.5em;
  font-weight: 900;
  text-align: right;
  margin-right: 0.5em;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title .name {
  width: 100%;
  flex-grow: 1;
  align-content: space-between;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .title .info {
  flex-grow: 0;
  font-size: 1.5em;
  display: inline-block;
  width: 1.5em;
  margin-left: 0.5em;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .details {
  color: #20222c;
  background: #aaaaaa;
  border-radius: 3px;
  width: 90%;
  white-space: normal;
  word-wrap: break-word;
  display: none;
  max-height: 0;
  transition: max-height 0.2s;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .details.active {
  margin: 10px;
  padding: 10px;
  display: block;
  max-height: 600px;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element .info::before {
  font-family: "Octicons Regular";
  content: "\f0a4";
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .list .list-element.active .info::before {
  font-family: "Octicons Regular";
  content: "\f0a3";
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .constants-list .bullet {
  color: #ffa500;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .static-properties-list .bullet {
  color: #f5e11d;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .static-methods-list .bullet {
  color: #db2ff4;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .properties-list .bullet {
  color: #6dba09;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .lists-container .methods-list .bullet {
  color: #008aff;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .filter-container {
  flex-grow: 0;
  flex-shrink: 0;
  padding: 10px 15px;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .search-container {
  flex-grow: 0;
  flex-shrink: 0;
  padding: 10px 15px;
  margin-bottom: 20px;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .empty-view-container {
  display: flex;
  flex-direction: column;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .empty-view-container .empty-view-title {
  padding: 10px 15px;
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .empty-view-container .empty-view-title .warning::before {
  margin-right: 1em;
  font-family: "Octicons Regular";
  content: "\f02d";
}
atom-php-integrator-symbol-viewer atom-php-integrator-symbol-viewer-content .empty-view-container .empty-view-content {
  padding: 10px 15px;
}
